import React from 'react';
import './App.css';
import {useSelector} from 'react-redux'

//Action
const login = () => {
  return {
    type: 'LOGIN'
  }
}

function App() {
  const isLoggedin = useSelector(state=> state.isLoggedin)
  return (
    <div>
      <h1>{isLoggedin}</h1>
      <button onClick={useDispatch(login)}>Login</button>
    </div>
  );
}

export default App;
